import React from "react";
import { useParams } from "react-router-dom";
const EventDetail = ({ event }) => {
  const { eventId } = useParams();
  const thisEvent = event.find((ev) => ev.id === eventId);
  return (
    <>
      <h1>sa</h1>
      <h1>{thisEvent.id}</h1>
      <h1>{thisEvent.name}</h1>
    </>
  );
};

export default EventDetail;
